   {"symbol": "ALDH9A1", "gene": "aldehyde dehydrogenase 9 family member A1", "chromosome": "1q24.1", "product": "4-trimethylaminobutyraldehyde dehydrogenase isoform 1", "hgncID": "HGNC:412", "summary": "This protein belongs to the aldehyde dehydrogenase family of proteins. It has a high activity for oxidation of gamma-aminobutyraldehyde and other amino aldehydes. The enzyme catalyzes the dehydrogenation of gamma-aminobutyraldehyde to gamma-aminobutyric acid (GABA). This isozyme is a tetramer of identical 54-kD subunits. [provided by RefSeq, Jul 2008].", "omimID": "602733" },
