   {"symbol": "CD44", "gene": "CD44 molecule (Indian blood group)", "chromosome": "11p13", "product": "CD44 antigen isoform 1 precursor", "geneGroupName": "Blood group antigens|CD molecules|Proteoglycans", "ensemblGeneID": "ENSG00000026508", "enzymeIDs": "", "definition": "Homo sapiens CD44 molecule (Indian blood group) (CD44), transcript variant 1, mRNA" },
   {"symbol": "HJURP", "gene": "Holliday junction recognition protein", "chromosome": "2q37.1", "product": "Holliday junction recognition protein isoform b", "hgncID": "HGNC:25444", "summary": "", "omimID": "612667" },
   {"symbol": "EGFR", "gene": "epidermal growth factor receptor", "chromosome": "7p11.2", "product": "epidermal growth factor receptor isoform e precursor", "hgncID": "HGNC:3236", "summary": "The protein encoded by this gene is a transmembrane glycoprotein that is a member of the protein kinase superfamily. This protein is a receptor for members of the epidermal growth factor family. EGFR is a cell surface protein that binds to epidermal growth factor, thus inducing receptor dimerization and tyrosine autophosphorylation leading to cell proliferation. Mutations in this gene are associated with lung cancer. EGFR is a component of the cytokine storm which contributes to a severe form of Coronavirus Disease 2019 (COVID-19) resulting from infection with severe acute respiratory syndrome coronavirus-2 (SARS-CoV-2). [provided by RefSeq, Jul 2020].", "omimID": "131550" },
   {"symbol": "ALDOA", "gene": "aldolase, fructose-bisphosphate A", "chromosome": "16p11.2", "product": "fructose-bisphosphate aldolase A isoform 1", "geneGroupName": "Aldolases", "ensemblGeneID": "ENSG00000149925", "enzymeIDs": "4.1.2.13", "definition": "Homo sapiens aldolase, fructose-bisphosphate A (ALDOA), transcript variant 4, mRNA" },
   {"symbol": "ALDOB", "gene": "aldolase, fructose-bisphosphate B", "chromosome": "9q31.1", "product": "fructose-bisphosphate aldolase B", "geneGroupName": "Aldolases", "ensemblGeneID": "ENSG00000136872", "enzymeIDs": "4.1.2.13", "definition": "Homo sapiens aldolase, fructose-bisphosphate B (ALDOB), mRNA" },
   {"symbol": "ALDOC", "gene": "aldolase, fructose-bisphosphate C", "chromosome": "17q11.2", "product": "fructose-bisphosphate aldolase C", "hgncID": "HGNC:418", "summary": "This gene encodes a member of the class I fructose-biphosphate aldolase gene family. Expressed specifically in the hippocampus and Purkinje cells of the brain, the encoded protein is a glycolytic enzyme that catalyzes the reversible aldol cleavage of fructose-1,6-biphosphate and fructose 1-phosphate to dihydroxyacetone phosphate and either glyceraldehyde-3-phosphate or glyceraldehyde, respectively. [provided by RefSeq, Jul 2008].", "omimID": "103870" },
   {"symbol": "ALKBH2", "gene": "alkB homolog 2, alpha-ketoglutarate dependent dioxygenase", "chromosome": "12q24.11", "product": "DNA oxidative demethylase ALKBH2 isoform 1", "geneGroupName": "Alkylation repair homologs", "ensemblGeneID": "ENSG00000189046", "enzymeIDs": "", "definition": "Homo sapiens alkB homolog 2, alpha-ketoglutarate dependent dioxygenase (ALKBH2), transcript variant 2, mRNA" },
   {"symbol": "HBA1", "gene": "hemoglobin subunit alpha 1", "chromosome": "16p13.3", "product": "hemoglobin subunit alpha", "hgncID": "HGNC:4823", "summary": "The human alpha globin gene cluster located on chromosome 16 spans about 30 kb and includes seven loci: 5'- zeta - pseudozeta - mu - pseudoalpha-1 - alpha-2 - alpha-1 - theta - 3'. The alpha-2 (HBA2) and alpha-1 (HBA1) coding sequences are identical. These genes differ slightly over the 5' untranslated regions and the introns, but they differ significantly over the 3' untranslated regions. Two alpha chains plus two beta chains constitute HbA, which in normal adult life comprises about 97% of the total hemoglobi", "omimID": "141800" },
   {"symbol": "HBA2", "gene": "hemoglobin subunit alpha 2", "chromosome": "16p13.3", "accessionInterval": "NM_000517.6", "geneGroupName": "Hemoglobin subunits", "note": "alpha globin; alpha-2 globin; hemoglobin alpha chain; mutant hemoglobin alpha 2 globin chain; hemoglobin, alpha 2; truncated HbA2" },
   {"symbol": "HBB", "gene": "hemoglobin subunit beta", "chromosome": "11p15.4", "accessionInterval": "NM_000518.5", "geneGroupName": "Hemoglobin subunits", "note": "beta globin chain; hemoglobin, beta; hemoglobin beta subunit" },
   {"symbol": "HBZ", "gene": "hemoglobin subunit zeta", "chromosome": "16p13.3", "product": "hemoglobin subunit zeta", "geneGroupName": "Hemoglobin subunits", "ensemblGeneID": "ENSG00000130656", "enzymeIDs": "", "definition": "Homo sapiens hemoglobin subunit zeta (HBZ), mRNA" },
   {"symbol": "TXNIP", "gene": "thioredoxin interacting protein", "chromosome": "1q21.1", "product": "thioredoxin-interacting protein isoform 2", "geneGroupName": "Alpha arrestins", "ensemblGeneID": "ENSG00000265972", "enzymeIDs": "", "definition": "Homo sapiens thioredoxin interacting protein (TXNIP), transcript variant 2, mRNA" },
   {"symbol": "EPRS1", "gene": "glutamyl-prolyl-tRNA synthetase 1", "chromosome": "1q41", "accessionInterval": "NM_004446.3", "geneGroupName": "Aminoacyl tRNA synthetases, Class I|Aminoacyl tRNA synthetases, Class II", "note": "glutamate tRNA ligase; glutaminyl-tRNA synthetase; proline-tRNA ligase; prolyl-tRNA synthetase; bifunctional aminoacyl-tRNA synthetase; proliferation-inducing protein 32; proliferation-inducing gene 32 protein; cell proliferation-inducing gene 32 protein; glutamatyl-prolyl-tRNA synthetase" },
   {"symbol": "QARS1", "gene": "glutaminyl-tRNA synthetase 1", "chromosome": "3p21.31", "accessionInterval": "NM_001272073.2", "geneGroupName": "Aminoacyl tRNA synthetases, Class I|MicroRNA protein coding host genes", "note": "isoform b is encoded by transcript variant 2; glutamine-tRNA synthetase; glutamine--tRNA ligase" },
   {"symbol": "DARS1", "gene": "aspartyl-tRNA synthetase 1", "chromosome": "2q21.3", "product": "aspartate--tRNA ligase, cytoplasmic isoform 2", "geneGroupName": "Aminoacyl tRNA synthetases, Class II", "ensemblGeneID": "ENSG00000115866", "enzymeIDs": "6.1.1.12", "definition": "Homo sapiens aspartyl-tRNA synthetase 1 (DARS1), transcript variant 2, mRNA" },
   {"symbol": "FARSA", "gene": "phenylalanyl-tRNA synthetase subunit alpha", "chromosome": "19p13.13", "product": "phenylalanine--tRNA ligase alpha subunit", "hgncID": "HGNC:3592", "summary": "Aminoacyl-tRNA synthetases are a class of enzymes that charge tRNAs with their cognate amino acids. This gene encodes a product which is similar to the catalytic subunit of prokaryotic and Saccharomyces cerevisiae phenylalanyl-tRNA synthetases (PheRS). This gene product has been shown to be expressed in a tumor-selective and cell cycle stage- and differentiation-dependent manner, the first member of the tRNA synthetase gene family shown to exhibit this type of regulated expression [provided by RefSeq, Jul 2008].", "omimID": "602918" },
   {"symbol": "FARSB", "gene": "phenylalanyl-tRNA synthetase subunit beta", "chromosome": "2q36.1", "product": "phenylalanine--tRNA ligase beta subunit", "hgncID": "HGNC:17800", "summary": "This gene encodes a highly conserved enzyme that belongs to the aminoacyl-tRNA synthetase class IIc subfamily. This enzyme comprises the regulatory beta subunits that form a tetramer with two catalytic alpha subunits. In the presence of ATP, this tetramer is responsible for attaching L-phenylalanine to the terminal adenosine of the appropriate tRNA. A pseudogene located on chromosome 10 has been identified. Alternative splicing results in multiple transcript variants. [provided by RefSeq, Jan 2015].", "omimID": "609690" },
   {"symbol": "GARS1", "gene": "glycyl-tRNA synthetase 1", "chromosome": "7p14.3", "product": "glycine--tRNA ligase isoform 2", "hgncID": "HGNC:4162", "summary": "This gene encodes glycyl-tRNA synthetase, one of the aminoacyl-tRNA synthetases that charge tRNAs with their cognate amino acids. The encoded enzyme is an (alpha)2 dimer which belongs to the class II family of tRNA synthetases. It has been shown to be a target of autoantibodies in the human autoimmune diseases, polymyositis or dermatomyositis. Two transcript variants encoding different isoforms have been found for this gene. [provided by RefSeq, Oct 2015].", "omimID": "600287" },
   {"symbol": "KARS1", "gene": "lysyl-tRNA synthetase 1", "chromosome": "16q23.1", "product": "lysine--tRNA ligase isoform 1", "geneGroupName": "Aminoacyl tRNA synthetases, Class II", "ensemblGeneID": "ENSG00000065427", "enzymeIDs": "6.1.1.6", "definition": "Homo sapiens lysyl-tRNA synthetase 1 (KARS1), transcript variant 1, mRNA" },
   {"symbol": "SARS1", "gene": "seryl-tRNA synthetase 1", "chromosome": "1p13.3", "accessionInterval": "NM_001330669.1", "geneGroupName": "Aminoacyl tRNA synthetases, Class II", "note": "isoform b is encoded by transcript variant 3; serine tRNA ligase 1, cytoplasmic; seryl-tRNA(Ser/Sec) synthetase; seryl-tRNA synthetase, cytoplasmic; serine--tRNA ligase, cytoplasmic" },
   {"symbol": "DNPEP", "gene": "aspartyl aminopeptidase", "chromosome": "2q35", "product": "aspartyl aminopeptidase isoform a", "geneGroupName": "Aminopeptidases", "ensemblGeneID": "ENSG00000123992", "enzymeIDs": "", "definition": "Homo sapiens aspartyl aminopeptidase (DNPEP), transcript variant 1, mRNA" },
   {"symbol": "ERAP1", "gene": "endoplasmic reticulum aminopeptidase 1", "chromosome": "5q15", "product": "endoplasmic reticulum aminopeptidase 1 isoform b precursor", "geneGroupName": "Aminopeptidases|M1 metallopeptidases|Minor histocompatibility antigens", "ensemblGeneID": "ENSG00000164307", "enzymeIDs": "", "definition": "Homo sapiens endoplasmic reticulum aminopeptidase 1 (ERAP1), transcript variant 2, mRNA" },
   {"symbol": "LNPEP", "gene": "leucyl and cystinyl aminopeptidase", "chromosome": "5q15", "product": "leucyl-cystinyl aminopeptidase isoform 1", "hgncID": "HGNC:6656", "summary": "This gene encodes a zinc-dependent aminopeptidase that cleaves vasopressin, oxytocin, lys-bradykinin, met-enkephalin, dynorphin A and other peptide hormones. The protein can be secreted in maternal serum, reside in intracellular vesicles with the insulin-responsive glucose transporter GLUT4, or form a type II integral membrane glycoprotein. The protein catalyzes the final step in the conversion of angiotensinogen to angiotensin IV (AT4) and is also a receptor for AT4. Alternative splicing results in multiple transcript variants encoding different isoforms. [provided by RefSeq, Jul 2008].", "omimID": "151300" },
   {"symbol": "SLC3A2", "gene": "solute carrier family 3 member 2", "chromosome": "11q12.3", "product": "4F2 cell-surface antigen heavy chain isoform b", "hgncID": "HGNC:11026", "summary": "This gene is a member of the solute carrier family and encodes a cell surface, transmembrane protein. The protein exists as the heavy chain of a heterodimer, covalently bound through di-sulfide bonds to one of several possible light chains. The encoded transporter plays a role in regulation of intracellular calcium levels and transports L-type amino acids. Alternatively spliced transcript variants, encoding different isoforms, have been characterized. [provided by RefSeq, Nov 2010].", "omimID": "158070" },
   {"symbol": "ANAPC1", "gene": "anaphase promoting complex subunit 1", "chromosome": "2q13", "accessionInterval": "NM_022662.4", "geneGroupName": "Anaphase promoting complex |MicroRNA protein coding host genes", "note": "anaphase-promoting complex 1 (meiotic checkpoint regulator); cyclosome subunit 1; mitotic checkpoint regulator; testis-specific gene 24 protein" },
   {"symbol": "ANAPC2", "gene": "anaphase promoting complex subunit 2", "chromosome": "9q34.3", "product": "anaphase-promoting complex subunit 2", "hgncID": "HGNC:19989", "summary": "A large protein complex, termed the anaphase-promoting complex (APC), or the cyclosome, promotes metaphase-anaphase transition by ubiquitinating its specific substrates such as mitotic cyclins and anaphase inhibitor, which are subsequently degraded by the 26S proteasome. Biochemical studies have shown that the vertebrate APC contains eight subunits. The composition of the APC is highly conserved in organisms from yeast to humans. The product of this gene is a component of the complex and shares sequence similarity with a recently identified family of proteins called cullins, which may also be involved in ubiquitin-mediated degradation. [provided by RefSeq, Jul 2008].", "omimID": "606946" },
   {"symbol": "ANAPC4", "gene": "anaphase promoting complex subunit 4", "chromosome": "4p15.2", "product": "anaphase-promoting complex subunit 4 isoform 1", "hgncID": "HGNC:19990", "summary": "A large protein complex, termed the anaphase-promoting complex (APC), or the cyclosome, promotes metaphase-anaphase transition by ubiquitinating its specific substrates such as mitotic cyclins and anaphase inhibitor, which are subsequently degraded by the 26S proteasome. Biochemical studies have shown that the vertebrate APC contains eight subunits. The composition of the APC is highly conserved in organisms from yeast to humans. The exact function of this gene product is not known. Two transcript variants encoding different isoforms have been found for this gene. [provided by RefSeq, Nov 2013].", "omimID": "606947" },
   {"symbol": "AQP1", "gene": "aquaporin 1 (Colton blood group)", "chromosome": "7p14.3", "product": "aquaporin-1 isoform 5", "hgncID": "HGNC:633", "summary": "This gene encodes a small integral membrane protein with six bilayer spanning domains that functions as a water channel protein. This protein permits passive transport of water along an osmotic gradient. This gene is a possible candidate for disorders involving imbalance in ocular fluid movement. [provided by RefSeq, Aug 2016].", "omimID": "107776" },
   {"symbol": "AQP2", "gene": "aquaporin 2", "chromosome": "12q13.12", "product": "aquaporin-2", "geneGroupName": "Aquaporins", "ensemblGeneID": "ENSG00000167580", "enzymeIDs": "", "definition": "Homo sapiens aquaporin 2 (AQP2), mRNA" },
   {"symbol": "AQP4", "gene": "aquaporin 4", "chromosome": "18q11.2", "product": "aquaporin-4 isoform M1x", "geneGroupName": "Aquaporins", "ensemblGeneID": "ENSG00000171885", "enzymeIDs": "", "definition": "Homo sapiens aquaporin 4 (AQP4), transcript variant 1, mRNA" },
   {"symbol": "AQP5", "gene": "aquaporin 5", "chromosome": "12q13.12", "accessionInterval": "NM_001651.4", "geneGroupName": "Aquaporins", "note": "" },
   {"symbol": "AQP7", "gene": "aquaporin 7", "chromosome": "9p13.3", "product": "aquaporin-7 isoform 1", "hgncID": "HGNC:640", "summary": "This gene encodes a member of the aquaporin family of water-selective membrane channels. The encoded protein localizes to the plasma membrane and allows movement of water, glycerol and urea across cell membranes. This gene is highly expressed in the adipose tissue where the encoded protein facilitates efflux of glycerol. In the proximal straight tubules of kidney, the encoded protein is localized to the apical membrane and prevents excretion of glycerol into urine. The encoded protein is present in spermatids, as well as in the testicular and epididymal spermatozoa suggesting an important role in late spermatogenesis. Alternative splicing of this gene results in multiple transcript variants encoding different isoforms. This gene is located adjacent to a related aquaporin gene on chromosome 9. Multiple pseudogenes of this gene have been identified. [provided by RefSeq, Dec 2015].", "omimID": "602974" },
   {"symbol": "ADAP1", "gene": "ArfGAP with dual PH domains 1", "chromosome": "7p22.3", "product": "arf-GAP with dual PH domain-containing protein 1 isoform 2", "hgncID": "HGNC:16486", "summary": "", "omimID": "608114" },
   {"symbol": "AVPR2", "gene": "arginine vasopressin receptor 2", "chromosome": "Xq28", "product": "vasopressin V2 receptor isoform 1", "geneGroupName": "Arginine vasopressin and oxytocin receptors", "ensemblGeneID": "ENSG00000126895", "enzymeIDs": "", "definition": "Homo sapiens arginine vasopressin receptor 2 (AVPR2), transcript variant 1, mRNA" },
   {"symbol": "AGO2", "gene": "argonaute RISC catalytic component 2", "chromosome": "8q24.3", "product": "protein argonaute-2 isoform 2", "hgncID": "HGNC:3263", "summary": "This gene encodes a member of the Argonaute family of proteins which play a role in RNA interference. The encoded protein is highly basic, and contains a PAZ domain and a PIWI domain. It may interact with dicer1 and play a role in short-interfering-RNA-mediated gene silencing. Multiple transcript variants encoding different isoforms have been found for this gene. [provided by RefSeq, Sep 2009].", "omimID": "606229" },
   {"symbol": "PIWIL1", "gene": "piwi like RNA-mediated gene silencing 1", "chromosome": "12q24.33", "product": "piwi-like protein 1 isoform 2", "geneGroupName": "Argonaute/PIWI family", "ensemblGeneID": "ENSG00000125207", "enzymeIDs": "", "definition": "Homo sapiens piwi like RNA-mediated gene silencing 1 (PIWIL1), transcript variant 2, mRNA" },
   {"symbol": "ATM", "gene": "ATM serine/threonine kinase", "chromosome": "11q22.3", "accessionInterval": "NM_000051.4", "geneGroupName": "Armadillo like helical domain containing", "note": "isoform a is encoded by transcript variant 2; AT mutated; serine-protein kinase ATM; TEL1, telomere maintenance 1, homolog; A-T mutated; ataxia telangiectasia mutated" },
   {"symbol": "ATR", "gene": "ATR serine/threonine kinase", "chromosome": "3q23", "product": "serine/threonine-protein kinase ATR isoform 1", "geneGroupName": "Armadillo like helical domain containing", "ensemblGeneID": "ENSG00000175054", "enzymeIDs": "", "definition": "Homo sapiens ATR serine/threonine kinase (ATR), transcript variant 1, mRNA" },
   {"symbol": "CAB39", "gene": "calcium binding protein 39", "chromosome": "2q37.1", "product": "calcium-binding protein 39", "geneGroupName": "Armadillo like helical domain containing", "ensemblGeneID": "ENSG00000135932", "enzymeIDs": "", "definition": "Homo sapiens calcium binding protein 39 (CAB39), transcript variant 2, mRNA" },
   {"symbol": "CAND1", "gene": "cullin associated and neddylation dissociated 1", "chromosome": "12q14.3-q15", "product": "cullin-associated NEDD8-dissociated protein 1 isoform 2", "hgncID": "HGNC:30688", "summary": "This gene encodes an essential regulator of Cullin-RING ubiquitin ligases, which are in involved in ubiquitinylation of proteins degraded by the Ub proteasome system. The encoded protein binds to unneddylated cullin-RING box protein complexes and acts as an inhibitor of cullin neddylation and of Skp1, cullin, and F box ubiquitin ligase complex assembly and activity. In mammalian cell culture, this protein predominantly localizes to the cytoplasm. Knockdown of this gene in preadipocytes results in blocked adipogenesis. Alternative splicing results in multiple transcript variants. [provided by RefSeq, Jul 2016].", "omimID": "607727" },
   {"symbol": "DIAPH3", "gene": "diaphanous related formin 3", "chromosome": "13q21.2", "product": "protein diaphanous homolog 3 isoform a", "geneGroupName": "Armadillo like helical domain containing|Formins", "ensemblGeneID": "ENSG00000139734", "enzymeIDs": "", "definition": "Homo sapiens diaphanous related formin 3 (DIAPH3), transcript variant 1, mRNA" },
   {"symbol": "FANCD2", "gene": "FA complementation group D2", "chromosome": "3p25.3", "geneGroupName": "Armadillo like helical domain containing|FA complementation groups", "ensemblGeneID": "ENSG00000144554", "enzymeIDs": "" },
   {"symbol": "FMNL1", "gene": "formin like 1", "chromosome": "17q21.31", "geneGroupName": "Armadillo like helical domain containing|Formins" },
   {"symbol": "NUP205", "gene": "nucleoporin 205", "chromosome": "7q33", "geneGroupName": "Armadillo like helical domain containing|Nucleoporins", "ensemblGeneID": "ENSG00000155561", "enzymeIDs": "" },
   {"symbol": "PI4KA", "gene": "phosphatidylinositol 4-kinase alpha", "chromosome": "22q11.21", "geneGroupName": "Armadillo like helical domain containing|PI4KA lipid kinase complex", "ensemblGeneID": "ENSG00000241973", "enzymeIDs": "" },
   {"symbol": "PRKDC", "gene": "protein kinase, DNA-activated, catalytic subunit", "chromosome": "8q11.21", "hgncID": "HGNC:9413", "omimID": "600899" },
   {"symbol": "PSME4", "gene": "proteasome activator subunit 4", "chromosome": "2p16.2", "geneGroupName": "Armadillo like helical domain containing|Proteasome" },
   {"symbol": "RICTOR", "gene": "RPTOR independent companion of MTOR complex 2", "chromosome": "5p13.1", "hgncID": "HGNC:28611", "omimID": "609022" },
   {"symbol": "SF3B2", "gene": "splicing factor 3b subunit 2", "chromosome": "11q13.1", "product": "splicing factor 3B subunit 2", "hgncID": "HGNC:10769", "summary": "This gene encodes subunit 2 of the splicing factor 3b protein complex. Splicing factor 3b, together with splicing factor 3a and a 12S RNA unit, forms the U2 small nuclear ribonucleoproteins complex (U2 snRNP). The splicing factor 3b/3a complex binds pre-mRNA upstream of the intron's branch site in a sequence-independent manner and may anchor the U2 snRNP to the pre-mRNA. Splicing factor 3b is also a component of the minor U12-type spliceosome. Subunit 2 associates with pre-mRNA upstream of the branch site at the anchoring site. Subunit 2 also interacts directly with subunit 4 of the splicing factor 3b complex. Subunit 2 is a highly hydrophilic protein with a proline-rich N-terminus and a glutamate-rich stretch in the C-terminus. [provided by RefSeq, Jul 2008].", "omimID": "605591" },
   {"symbol": "SYMPK", "gene": "symplekin", "chromosome": "19q13.32", "accessionInterval": "NM_004819.3", "geneGroupName": "Armadillo like helical domain containing", "note": "" },
   {"symbol": "TSC1", "gene": "TSC complex subunit 1", "chromosome": "9q34", "product": "hamartin isoform 1", "hgncID": "HGNC:12362", "summary": "This gene is a tumor suppressor gene that encodes the growth inhibitory protein hamartin. The encoded protein interacts with and stabilizes the GTPase activating protein tuberin. This hamartin-tuberin complex negatively regulates mammalian target of rapamycin complex 1 (mTORC1) signalling which is a major regulator of anabolic cell growth. This protein also functions as a co-chaperone for Hsp90 that inhibits its ATPase activity. This protein functions as a facilitator of Hsp90-mediated folding of kinase and non-kinase clients, including Tsc2 and thereby preventing their ubiquitination and proteasomal degradation. Mutations in this gene have been associated with tuberous sclerosis. [provided by RefSeq, Apr 2018].", "omimID": "605284" },
   {"symbol": "APC", "gene": "APC regulator of WNT signaling pathway", "chromosome": "5q22.2", "accessionInterval": "NM_000038.6", "geneGroupName": "Armadillo repeat containing|Protein phosphatase 1 regulatory subunits", "note": "isoform b is encoded by transcript variant 3; adenomatosis polyposis coli tumor suppressor; deleted in polyposis 2.5; adenomatous polyposis coli protein; protein phosphatase 1, regulatory subunit 46; truncated adenomatosis polyposis coli; WNT signaling pathway regulator; APC, WNT signaling pathway regulator; adenomatous polyposis coli (APC); epididymis secretory sperm binding protein" },
   {"symbol": "KPNA2", "gene": "karyopherin subunit alpha 2", "chromosome": "17q24.2", "accessionInterval": "NM_001320611.2", "geneGroupName": "Armadillo repeat containing|Importins", "note": "karyopherin alpha 2 (RAG cohort 1, importin alpha 1); importin-alpha-P1; pendulin; RAG cohort protein 1; importin subunit alpha-2" },
   {"symbol": "AQR", "gene": "aquarius intron-binding spliceosomal factor", "chromosome": "15q14", "product": "RNA helicase aquarius", "hgncID": "HGNC:29513", "summary": "", "omimID": "610548" },
   {"symbol": "MT-CO1", "gene": "mitochondrially encoded cytochrome c oxidase I", "chromosome": "mitochondria", "geneGroupName": "Mitochondrially encoded protein coding genes|Mitochondrial complex IV: cytoch" },
   {"symbol": "MEP1B", "gene": "meprin A subunit beta", "chromosome": "18q12.1", "product": "meprin A subunit beta isoform 2 precursor", "hgncID": "HGNC:7020", "summary": "Meprins are multidomain zinc metalloproteases that are highly expressed in mammalian kidney and intestinal brush border membranes, and in leukocytes and certain cancer cells. They are involved in the hydrolysis of a variety of peptide and protein substrates, and have been implicated in cancer and intestinal inflammation. Mature meprins are oligomers of evolutionarily related, but separately encoded alpha and/or beta subunits. Homooligomers of alpha subunit are secreted, whereas, oligomers containing the beta subunit are plasma membrane-bound. This gene encodes the beta subunit. Targeted disruption of this gene in mice affects embryonic viability, renal gene expression profiles, and distribution of the membrane-associated alpha subunit in kidney and intestine. [provided by RefSeq, Oct 2011].", "omimID": "600389" },
   {"symbol": "DUSP26", "gene": "dual specificity phosphatase 26", "chromosome": "8p12", "product": "dual specificity protein phosphatase 26", "hgncID": "HGNC:28161", "summary": "This gene encodes a member of the tyrosine phosphatase family of proteins and exhibits dual specificity by dephosphorylating tyrosine as well as serine and threonine residues. This gene has been described as both a tumor suppressor and an oncogene depending on the cellular context. This protein may regulate neuronal proliferation and has been implicated in the progression of glioblastoma through its ability to dephosphorylate the p53 tumor suppressor. Alternative splicing results in multiple transcript variants. [provided by RefSeq, Feb 2015].", "omimID": "618368" },
   {"symbol": "RNGTT", "gene": "RNA guanylyltransferase and 5'-phosphatase", "chromosome": "6q15", "product": "mRNA-capping enzyme isoform b", "hgncID": "HGNC:10073", "summary": "", "omimID": "603512" },
   {"symbol": "ATG3", "gene": "autophagy related 3", "chromosome": "3q13.2", "accessionInterval": "NM_001278712.2", "geneGroupName": "Autophagy related", "note": "isoform 2 is encoded by transcript variant 2; 2610016C12Rik; ATG3 autophagy related 3 homolog; hApg3; autophagy-related protein 3; ubiquitin-like-conjugating enzyme ATG3; APG3 autophagy 3-like" },
   {"symbol": "ATG5", "gene": "autophagy related 5", "chromosome": "6q21", "product": "autophagy protein 5 isoform a", "geneGroupName": "Autophagy related", "ensemblGeneID": "ENSG00000057663", "enzymeIDs": "", "definition": "Homo sapiens autophagy related 5 (ATG5), transcript variant 2, mRNA" },
   {"symbol": "ATG12", "gene": "autophagy related 12", "chromosome": "5q22.3", "product": "ubiquitin-like protein ATG12 isoform 2", "hgncID": "HGNC:588", "summary": "Autophagy is a process of bulk protein degradation in which cytoplasmic components, including organelles, are enclosed in double-membrane structures called autophagosomes and delivered to lysosomes or vacuoles for degradation. ATG12 is the human homolog of a yeast protein involved in autophagy (Mizushima et al., 1998 [PubMed 9852036]).[supplied by OMIM, Mar 2008].", "omimID": "609608" },
   {"symbol": "ATG16L1", "gene": "autophagy related 16 like 1", "chromosome": "2q37.1", "product": "autophagy-related protein 16-1 isoform 4", "hgncID": "HGNC:21498", "summary": "The protein encoded by this gene is part of a large protein complex that is necessary for autophagy, the major process by which intracellular components are targeted to lysosomes for degradation. Defects in this gene are a cause of susceptibility to inflammatory bowel disease type 10 (IBD10). Several transcript variants encoding different isoforms have been found for this gene.[provided by RefSeq, Jun 2010].", "omimID": "610767" },
